css:
@-moz-document domain("www.bitview.net") {
#masthead .logo {
     content: url(https://i.imgur.com/CvVcoKo.png) ;
    float: left;
    display: block;
    margin: 1px 1px 6px 0;
}

element.style {
    width: 480px;
    height: 360px;
    padding-bottom: 32px;
}
#smallMastheadLogo {
    content: url(https://i.imgur.com/RpsPB5k.gif) ;
    width: 104px;
    height: 37px;
    border: 0;
}

#searchField {
    width: 280px;
    color: #000000;
    font-size: 12px;
}
}

@-moz-document url-prefix("http://www.bitview.net/profile.php") {
element.style {
    width: 424px;
    height: 320px;
    text-align: center;
    padding-bottom: 32px;
}
}
